import React from 'react'
import TextField from '@mui/material/TextField';
import { Box } from '@mui/material';

export const TextFeildForMail = () => {
  return (
    <div>
      <Box
        component="form"
        sx={{
          '& .MuiTextField-root': { m: 1, width: '70ch' },
        }}
        noValidate
        autoComplete="off"
      >
        <div>
          <TextField
            id="standard-multiline-flexible"
            label="Search note..!"
            multiline
            maxRows={4}
            variant="standard"
          />
        </div>
      </Box>
    </div>
  )
}
